using System;
using System.Drawing;
using System.IO;
using System.Reflection;

namespace TinyTools.Modules.ScreenDimmer
{
    public static class ScreenDimmerResources
    {
        // Base64 encoded ScreenDimmer icon - will be populated by build script
        private static readonly string IconBase64 = GetIconBase64();

        private static string GetIconBase64()
        {
            // This will be populated by reading the icon file during compilation
            // For now, return empty string and we'll update this
            return "";
        }

        public static Icon GetScreenDimmerIcon()
        {
            try
            {
                if (!string.IsNullOrEmpty(IconBase64))
                {
                    byte[] iconBytes = Convert.FromBase64String(IconBase64);
                    using (var stream = new MemoryStream(iconBytes))
                    {
                        return new Icon(stream);
                    }
                }
            }
            catch (Exception ex)
            {
                System.Diagnostics.Debug.WriteLine($"Failed to load embedded ScreenDimmer icon: {ex.Message}");
            }

            // Fallback: try to load from file if available (development mode)
            try
            {
                var baseDir = Path.GetDirectoryName(Assembly.GetExecutingAssembly().Location) ?? "";
                var iconPaths = new string[]
                {
                    Path.Combine(baseDir, "modules", "ScreenDimmer", "icon.ico"),
                    Path.Combine(Directory.GetCurrentDirectory(), "modules", "ScreenDimmer", "icon.ico"),
                    Path.Combine(baseDir, "..", "..", "modules", "ScreenDimmer", "icon.ico")
                };
                
                foreach (var iconPath in iconPaths)
                {
                    if (File.Exists(iconPath))
                    {
                        return new Icon(iconPath);
                    }
                }
            }
            catch (Exception ex)
            {
                System.Diagnostics.Debug.WriteLine($"Failed to load ScreenDimmer icon from file: {ex.Message}");
            }

            // Final fallback to system icon
            return SystemIcons.Information; // Information icon is appropriate for screen/display tools
        }
    }
}



